      title: 'Performance Metrics',
      xaxis: {
        title: 'Time'
      },
      yaxis: {
        title: 'Requests per Second',
        showline: true,
        zeroline: true,
        showgrid: false
      },
      yaxis2: {
        title: 'Response Time (ms)',
        overlaying: 'y',
        side: 'right'
      }
    };

    Plotly.newPlot('plot1', data1, layout1);
    Plotly.newPlot('plot2', data2, layout2);

  </script>
